import React from "react"
import { Link } from "react-router-dom"

function Title(){
    return (
        <div id='tilt'>
            <h1>功能選單</h1>
            <ul>
                <li><Link to="/">首頁</Link></li>
                <li><Link to="/radomColor">隨機顏色</Link></li>
                {/* <li><Link to="/sameColor">關於我們</Link></li> */}
            </ul>
        </div>
    )
}

export default Title
